import React, { Component } from 'react';



function JournalContainer () {
    return (
            <div>
                <h1>My Journal</h1>
                <ul>
                    <li>Entry 1</li>
                    <li>Entry 2</li>
                    <li>Entry 3</li>
                </ul>
                <form>
                    <label>
                        New Entry:
                        <input type="text" name="entry" />
                    </label>
                    <button type="submit">Add Entry</button>
                </form>
            </div>
        );
    }
export default JournalContainer;
